import { axiosInstanceWithoutBearer, axiosInstanceWithBearer } from './axios';

export const postWatchList = async (
  token: string | null,
  productsId: number,
) => {
  const res = await axiosInstanceWithBearer.post(
    `/api/watchlist`,
    {
      productsId,
    },
    {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    },
  );
  return res;
};

export const deleteWatchList = async (
  token: string | null,
  productsId: number,
) => {
  const res = await axiosInstanceWithBearer.delete(`/api/watchlist`, {
    headers: {
      Authorization: `Bearer ${token}`,
    },
    data: {
      productsId,
    },
  });
  return res;
};
